<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">

    <title>Document</title>
</head>

<body>
    <script src="./List.js"></script>
    <script>
        var Arr = [1, 2, 3]
        var head = new LinkList(Arr).head
        /**
        * @param {ListNode} head
        * @return {number[]}
        */
        var reversePrint = function (head) {
            let nums = []
            let node = head
            while (node !== null) {
                nums.unshift(node.val)
                node = node.next
            }
            return nums
        };
        const result = reversePrint(head)
        console.log(result); // [3,2,1]
    </script>
</body>

</html>
